import React, { useState } from "react";

const GenericOrgPost = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="tiktok_org_post_wrapper">

      <div className="tiktok-title">
          <h3>Title: {props.title}</h3>

          {isOpen ? (
            <button className="tiktok-button" onClick={() => setIsOpen(!isOpen)}>Close</button>
            ) : 
            <button className="tiktok-button" onClick={() => setIsOpen(!isOpen)}>View</button>}

      </div>

      {isOpen ? (
        <div className="post-content">
          <p> <b>Audio name:</b> {props.audio}</p>
          <p> <b>Description:</b>  {props.script}</p>
          <button className="tiktok-button">Visualize</button>
        </div>
      ) : null}
    </div>
  );
};

export default GenericOrgPost;
